const MonsterData = [
    {
    name: "Wendigo",
    appearance: "Humanoid, can be over 6 feet, eyes are pushed back deep in their sockets, and have many layers of crooked, sharp, teeth, razor-like claws used to rip prey to shreds, sometimes said to have matted fur and have chunks of skin and flesh missing, due to consumption.",
    abilities: "Voice mimicry, immortality, super speed, superhuman strength, super agility, super senses, super stamina.",
    weaknesses: "Fire, anasazi symbols, iron, steel, silver.",
    photo: <img src = "http://www.supernaturalwiki.com/images/c/c2/Wendigo3.png"/>
    },
    {
    name: "Djinn",
    appearance: "Humanoid creatures with tattooed skin.",
    abilities: "Hallucinogenic Touch, pyrokinesis, telepathy, super strength, super speed, Shapeshifting, immortality, super agility.",
    weaknesses: "Siver and lamb blood.",
    photo: <img src = "https://static.wikia.nocookie.net/supernatural/images/7/71/Unnamed_Djinn.PNG/revision/latest?cb=20160719151722"/>
    },
];

export default MonsterData;
